import React from 'react';
import "./index.css"
import ConnectionVerifyAPI from "./API/ConnectionVerifyAPI";

function App() {

    var isconnected:boolean = false

    const response: ConnectionVerifyAPI = new ConnectionVerifyAPI()
    const  result = response.CheckProxy()
    result.then((value)=>{isconnected = value})
    console.log(isconnected)

    if(isconnected){
        return (
      <>
        <div>Hello World</div>
        <div></div>
      </>
        );
    }
    return(
        <div className={"w-full h-full bg-gradient-to-r from-cyan-500 to-blue-500"}></div>
    )
}

export default App;
